import React from 'react'
import StatusCard from './statusCard'

const StatusList = ({listID,listTitle, cards}) =>
{
  
    return (
        <div>
            <div>{listTitle}</div>
        <div>
       {cards.map(card => (<StatusCard key={card.cardI} title={card.title}/> ))} 
       </div>
        </div>
    )
}

export default StatusList;
